// pages/me/me.js
var app=getApp()
import { formatTime } from '../../utils/util.js';
Page({

  /**
   * 页面的初始数据
   */
  data: {
    backgroundimg:'data:image/jpg;base64,',

    userinfo:{},
    infocards:['个人信息','设置','留言'],
  },

  onLoad: function (options) {

  },

  onShow(){
    this.setData({
      userinfo:app.globalData.userinfo,
    })
  },

  onReady: function () {
    
  },

//在此授权（入库）
authorize(e){
  wx.showLoading({
    title: '授权中',
    mask: true,
  })
  if (e.detail.userInfo){
    //授权完成后直接登录
        var time = formatTime(new Date())
        var userinfo={}
        userinfo.name=e.detail.userInfo.nickName
        userinfo.avatarUrl=e.detail.userInfo.avatarUrl
        userinfo.gender=e.detail.userInfo.gender
        userinfo.userOpenid=app.globalData.userinfo.userOpenid
        userinfo.regtime=time
        app.globalData.userinfo=userinfo

        wx.request({
          url: app.globalData.serverurl+'Register',
          method: 'GET',
          data:userinfo,
          complete:res=>{wx.hideLoading()},
          success:result => {
            //console.log('signin result',userinfo)
            if(result.data.flag){
              wx.showLoading({
                title: '上传头像中',
                mask: true,
              })
              //上传用户头像
              wx.downloadFile({//下载用户现有微信头像
                url: userinfo.avatarUrl,
                complete:res=>{wx.hideLoading()},
                fail:res=>{
                  wx.showToast({
                    title: res.errMsg,
                    duration: 2000,
                    mask: true,
                  })
                },
                success:result => {
                  wx.showLoading({
                    title: '上传头像中',
                    mask: true,
                  })
                  //console.log('download success',userinfo)
                  var path=result.tempFilePath
                  wx.uploadFile({
                    filePath: path,
                    name: 'cover',
                    url: app.globalData.serverurl+'update_me_avatar',
                    header: {
                      'content-type': 'multipart/form-data'
                    },
                    formData: {
                      pid:userinfo.userOpenid
                    },
                    complete:res=>{wx.hideLoading()},
                    fail:res=>{
                      wx.showToast({
                        title: res.errMsg,
                        duration: 2000,
                        mask: true,
                      })
                    },
                    success: result => {
                      if(result.statusCode==200){
                        userinfo.avatarUrl=path
                        this.setData({
                          userinfo:userinfo
                        })
                        wx.showToast({
                          title: '授权成功！',
                          icon:'success'
                        })
                      }
                    },
                  })
                },
              })
            }else
              wx.showToast({
                title: '授权失败',
                icon:'none',
                duration:2000
              })
          }
        })
    }else{
      wx.hideLoading()
      wx.showToast({
        title: '尚未授权',
        duration:2000,
        icon:'none'
      })
    }
  },

  previewAvatar (e) {
    console.log(e)
    wx.previewImage({
      urls:[this.data.userinfo.avatarUrl],
      current: this.data.userinfo.avatarUrl,
    })
  },
  
  functions(e){
    console.log(e)
    var i=e.currentTarget.dataset.i
    switch (i) {
      case 0:
        wx.navigateTo({
          url: '../myinfo/myinfo',
          complete: (res) => {},
          fail: (res) => {},
          success: (result) => {
            result.eventChannel.emit('getData',{
              userinfo:this.data.userinfo
            })
          },
        })
        break;
    
      default:
        break;
    }

  }
})